import React from 'react';
import '../styles/Committee.css'; 

const Committee = () => {
    return (
        <div className="committee-container">
            <div className="committee">
                <img src="https://via.placeholder.com/150" alt="Committee 1" />
                <h2>Committee 1</h2>
                <p>This is some text for committee 1.</p>
            </div>
            <div className="committee">
                <img src="https://via.placeholder.com/150" alt="Committee 2" />
                <h2>Committee 2</h2>
                <p>This is some text for committee 2.</p>
            </div>
            <div className="committee">
                <img src="https://via.placeholder.com/150" alt="Committee 3" />
                <h2>Committee 3</h2>
                <p>This is some text for committee 3.</p>
            </div>
        </div>
    );
};

export default Committee;
